/* 
 *  Constructs a HelloBaseForm which is a child of 'parent', with the 
 *  name 'name' and widget flags set to 'f' 
 */
HelloBaseForm::HelloBaseForm( QWidget* parent,  const char* name, WFlags fl )
    : QWidget( parent, name, fl )
{
    QPixmap image0( ( const char** ) image0_data );
    if ( !name )
	setName( "HelloBaseForm" );
    resize( 228, 294 ); 
    setCursor( QCursor( 0 ) );
    setCaption( tr( "Qtopia Template (Xin Lan)" ) );

    dinosauPushButton = new QPushButton( this, "dinosauPushButton" );
    dinosauPushButton->setGeometry( QRect( 120, 250, 102, 30 ) ); 
    dinosauPushButton->setText( tr( "Dinosau" ) );

    girlPixmapLabel = new QLabel( this, "girlPixmapLabel" );
    girlPixmapLabel->setGeometry( QRect( 0, 0, 230, 250 ) ); 
    girlPixmapLabel->setPixmap( image0 );
    girlPixmapLabel->setScaledContents( TRUE );

    helloPushButton = new QPushButton( this, "helloPushButton" );
    helloPushButton->setGeometry( QRect( 10, 250, 102, 30 ) ); 
    helloPushButton->setText( tr( "Hello" ) );
}

